export const ExtractVerein = (
    club,
    vereinsName,
    vereinsKurz,
    vereinsStrasse,
    vereinsPLZ,
    vereinsOrt,
    vereinsTelefon,
    vereinsBank,
    vereinsKontoInhaber,
    vereinsKontoInhaberAdresse,
    vereinsIBAN,
    vereinsBIC
) => {
  for (const property in club) {
    switch (String(property)) {
      case "Verein_Name":
        vereinsName = club[property];
        break;
      case "Verein_Kurz":
        vereinsKurz = club[property];
        break;
      case "Verein_Strasse":
        vereinsStrasse = club[property];
        break;
      case "Verein_PLZ":
        vereinsPLZ = club[property];
        break;
      case "Verein_Ort":
        vereinsOrt = club[property];
        break;
      case "Verein_TelP":
        vereinsTelefon = club[property];
        break;
      case "Verein_Bankname":
        vereinsBank = club[property];
        break;
      case "Verein_KontoInhaber":
        vereinsKontoInhaber = club[property];
        break;
      case "Verein_KI_Anschrift":
        vereinsKontoInhaberAdresse = club[property];
        break;
      case "Verein_IBAN":
        vereinsIBAN = club[property];
        break;
      case "Verein_BIC":
        vereinsBIC = club[property];
        break;
      default:
        //console.log("Feld nicht zugewiesen");
        break;
    }
  }
  return { vereinsName, vereinsKurz, vereinsStrasse, vereinsPLZ, vereinsOrt, vereinsTelefon, vereinsBank, vereinsKontoInhaber, vereinsKontoInhaberAdresse, vereinsIBAN, vereinsBIC };
};
